import React from "react";
import styled from "styled-components";

const PJ_li = styled.div`
  div{
      float:right;
  }
`;

class Profile_PJ extends React.Component {
    render() {
        return (

            <div>
                <PJ_li>
                <h2>Project 목록</h2>
                <hr></hr>

                <div>
                    KDBC 논문 Web
                </div>
                <div>
                    코로나 간편 사이트
                </div>
                <div>
                    경기 공공체육시설 조회
                </div>
                <div>
                    My Portfolio
                </div>
                <div>
                    대학입시 부정입학 필터링
                </div>
                </PJ_li>
            </div>


        )
    }
}

export default Profile_PJ;
